from scipy.spatial import distance
import numpy as np
def get_adjacent_regions(regions):
    distances = {}
    for i in range(len(regions)):
        for j in range(i+1, len(regions)):
            dist = distance.euclidean((regions[i]['LATITUDE'], regions[i]['LONGITUDE']), (regions[j]['LATITUDE'], regions[j]['LONGITUDE']))
            distances[(regions[i]['REGION'], regions[j]['REGION])] = dist
            distances[(regions[j]['REGION'], regions[i]['REGION])] = dist
    adjacent_regions = [(k,v) for k,v in distances.items() if v < 50]
    return [r for r,_ in adjacent_regions]; 
df['NEIGHBOR_REGIONS'] = df.apply(lambda row: get_adjacent_regions(row), axis=1); 
similar_avg_marks = df.merge(df, left_on='REGION', right_on='NEIGHBOR_REGIONS')['AVG_MARK'].between(220,240)
